$(document).ready(function(){let e=$('tr[data-name="tableRow"]');$(e).length&&$(e).each((e,t)=>{$(t).click(()=>{window.location=$(t).data("href")})});let t=$(".table"),a=$(t).find("th").length,n=$("#tableEmpty");$(n).length&&$(n).attr("colspan",a),$("#dismiss-success-button").on("click",function(e){e.preventDefault();let t=$("#success-flash-alert");t.hasClass("d-none")||(t.find(".flash-message").remove(),t.addClass("d-none"))}),$("#dismiss-error-button").on("click",function(e){e.preventDefault();let t=$("#error-flash-alert");t.hasClass("d-none")||(t.find(".flash-message").remove(),t.addClass("d-none"))})});
